    false,nt"url": null,nt"notes": "This dataset has 5-day Acoustic Doppler
    Current Profiler (ADCP) water currents data from thenTAO/TRITON (Pacific Ocean,
    http://www.pmel.noaa.gov/tao/),nRAMA (Indian Ocean, http://www.pmel.noaa.gov/tao/rama/),
    andnPIRATA (Atlantic Ocean, http://www.pmel.noaa.gov/pirata/)narrays of moored buoys
    which transmit oceanographic and meteorological data to shore in real-time via the
    Argos satellite system.  These buoys are major components of the CLIVAR climate
    analysis project and the GOOS, GCOS, and GEOSS observing systems.  5-day data is
    an average of daily values collected during consecutive five day intervals.  A minimum
    of 2 daily values are required to compute a 5-day average.  ADCP data are available
    only after mooring recoveries, which are scheduled on an annual basis.  For more
    information, seenhttp://www.pmel.noaa.gov/tao/proj_over/proj_over.html .",nt"owner_org":
